import {
  BrowserRouter as Router,
  Routes,
  Route,
} from "react-router-dom";



import './App.css';
import Header from './components/Header';
import NotesListPage from './pages/NotesListPage';

function App() {
  return (
    <Router>

          <div className="App">
            <Header />

            <Routes>
              <Route exact path="/" Component={NotesListPage}  />
            </Routes>

          </div>

    </Router>

  );
}

export default App;
